import Layout from '../../components/MyLayout';
import Head from 'next/head';

export const config = { amp: true };

function TalksPage() {
  return (
    <Layout>
        <Head>
        <title>Naina Raisinghani</title>
        <link rel="icon" href="data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 100 100%22><text y=%22.9em%22 font-size=%2290%22>ðŸ’©</text></svg>" />
        <script async key="amp-youtube" custom-element="amp-youtube" src="https://cdn.ampproject.org/v0/amp-youtube-0.1.js"
            />
        </Head>
      <main>
        <div className="container">
            <amp-youtube data-videoid="s7OyBFLr9rY" layout="fixed" width="480" height="270"></amp-youtube>
            <div className="text">Some text goes here 1.</div>
            <amp-youtube data-videoid="Ez_wOEmH1P0" layout="fixed" width="480" height="270"></amp-youtube>
            <div className="text">Some text goes here 2.</div>
            <amp-youtube data-videoid="aRK85FSEsx0" layout="fixed" width="480" height="270"></amp-youtube>
            <div className="text">Some text goes here 3.</div>
            <amp-youtube data-videoid="UyPdVFbZ3gs" layout="fixed" width="480" height="270" ></amp-youtube>
            <div className="text">Some text goes here 4.</div>
        </div>
      </main>
    <style jsx>{`
    @font-face {
        font-family: 'Bai Jamjuree';
        font-style: sans-serif;
        src: url('https://fonts.googleapis.com/css?family=Bai+Jamjuree');
    }
    * {
        font-family: 'Bai Jamjuree', sans-serif;
        text-decoration: none;
    }
    main {
        top: 4em;
    }
    .container {
        display: grid;
        grid-template-columns: 480px 180px;
        grid-template-rows: auto;
        grid-gap: 10px;
    }
    .text {
        text-align: center;
        vertical-align: middles;
    }
  `}</style>
    </Layout>
  );
}

export default TalksPage;
